import React, { useState } from "react";
import { useNavigate } from "react-router-dom";
import heroBg from "../images/hero-bg.jpg";

const PartnershipSearch = () => {
  const navigate = useNavigate();
  const [location, setLocation] = useState({ state: "", city: "" });
  const [orgType, setOrgType] = useState("");
  const [goal, setGoal] = useState("");
  const [isLocationOpen, setIsLocationOpen] = useState(false);
  const [isTypeOpen, setIsTypeOpen] = useState(false);
  const [isGoalOpen, setIsGoalOpen] = useState(false);

  const US_STATES = [
    "California",
    "New York",
    "Texas",
    // ... 其他州
  ];

  const CITIES = {
    California: ["Los Angeles", "San Francisco", "San Diego"],
    "New York": ["New York City", "Buffalo", "Albany"],
    Texas: ["Houston", "Austin", "Dallas"],
    // ... 其他城市
  };

  return (
    <div className="min-h-screen relative">
      {/* 半透明背景图 */}
      <div className="absolute inset-0">
        <img
          src={heroBg}
          alt="Background"
          className="w-full h-full object-cover"
          style={{ filter: "brightness(0.7) saturate(0.7)" }}
        />
        <div className="absolute inset-0 bg-cyan-900/30 backdrop-blur-sm"></div>
      </div>

      {/* 返回按钮 */}
      <button
        onClick={() => navigate(-1)}
        className="absolute top-8 left-8 text-white hover:text-cyan-100 z-10"
      >
        <svg
          className="w-8 h-8"
          fill="none"
          stroke="currentColor"
          viewBox="0 0 24 24"
        >
          <path
            strokeLinecap="round"
            strokeLinejoin="round"
            strokeWidth="2"
            d="M10 19l-7-7m0 0l7-7m-7 7h18"
          />
        </svg>
      </button>

      {/* 主要内容 */}
      <div className="relative z-10 pt-32 px-4">
        <h1 className="text-5xl font-bold text-white text-center mb-12">
          Let's Find Your Perfect Partner
        </h1>

        <div className="max-w-4xl mx-auto bg-white/90 backdrop-blur-md rounded-xl p-6 shadow-lg">
          <div className="flex flex-wrap gap-4 items-center">
            {/* Location Dropdown */}
            <div className="relative flex-1 min-w-[200px]">
              <button
                onClick={() => {
                  setIsLocationOpen(!isLocationOpen);
                  setIsTypeOpen(false);
                  setIsGoalOpen(false);
                }}
                className="w-full px-4 py-3 text-left bg-white rounded-lg shadow flex items-center justify-between hover:bg-gray-50"
              >
                <span className="flex items-center gap-2">
                  <svg
                    className="w-5 h-5 text-cyan-600"
                    fill="none"
                    stroke="currentColor"
                    viewBox="0 0 24 24"
                  >
                    <path
                      strokeLinecap="round"
                      strokeLinejoin="round"
                      strokeWidth="2"
                      d="M17.657 16.657L13.414 20.9a1.998 1.998 0 01-2.827 0l-4.244-4.243a8 8 0 1111.314 0z"
                    />
                    <path
                      strokeLinecap="round"
                      strokeLinejoin="round"
                      strokeWidth="2"
                      d="M15 11a3 3 0 11-6 0 3 3 0 016 0z"
                    />
                  </svg>
                  {location.state && location.city
                    ? `${location.city}, ${location.state}`
                    : "Location"}
                </span>
                <svg
                  className={`w-5 h-5 transition-transform ${
                    isLocationOpen ? "rotate-180" : ""
                  }`}
                  fill="none"
                  stroke="currentColor"
                  viewBox="0 0 24 24"
                >
                  <path
                    strokeLinecap="round"
                    strokeLinejoin="round"
                    strokeWidth="2"
                    d="M19 9l-7 7-7-7"
                  />
                </svg>
              </button>

              {isLocationOpen && (
                <div className="absolute mt-2 w-full bg-white rounded-lg shadow-lg p-4 z-20">
                  <div className="grid grid-cols-2 gap-4">
                    <select
                      value={location.state}
                      onChange={(e) =>
                        setLocation({ state: e.target.value, city: "" })
                      }
                      className="block w-full rounded-md border-gray-300 shadow-sm focus:border-cyan-500 focus:ring-cyan-500"
                    >
                      <option value="">Select State</option>
                      {US_STATES.map((state) => (
                        <option key={state} value={state}>
                          {state}
                        </option>
                      ))}
                    </select>

                    <select
                      value={location.city}
                      onChange={(e) =>
                        setLocation({ ...location, city: e.target.value })
                      }
                      disabled={!location.state}
                      className="block w-full rounded-md border-gray-300 shadow-sm focus:border-cyan-500 focus:ring-cyan-500"
                    >
                      <option value="">Select City</option>
                      {location.state &&
                        CITIES[location.state].map((city) => (
                          <option key={city} value={city}>
                            {city}
                          </option>
                        ))}
                    </select>
                  </div>
                </div>
              )}
            </div>

            {/* Organization Type Dropdown */}
            <div className="relative flex-1 min-w-[200px]">
              <button
                onClick={() => {
                  setIsTypeOpen(!isTypeOpen);
                  setIsLocationOpen(false);
                  setIsGoalOpen(false);
                }}
                className="w-full px-4 py-3 text-left bg-white rounded-lg shadow flex items-center justify-between hover:bg-gray-50"
              >
                <span className="flex items-center gap-2">
                  <svg
                    className="w-5 h-5 text-cyan-600"
                    fill="none"
                    stroke="currentColor"
                    viewBox="0 0 24 24"
                  >
                    <path
                      strokeLinecap="round"
                      strokeLinejoin="round"
                      strokeWidth="2"
                      d="M19 21V5a2 2 0 00-2-2H7a2 2 0 00-2 2v16m14 0h2m-2 0h-5m-9 0H3m2 0h5M9 7h1m-1 4h1m4-4h1m-1 4h1m-5 10v-5a1 1 0 011-1h2a1 1 0 011 1v5m-4 0h4"
                    />
                  </svg>
                  {orgType || "Organization Type"}
                </span>
                <svg
                  className={`w-5 h-5 transition-transform ${
                    isTypeOpen ? "rotate-180" : ""
                  }`}
                  fill="none"
                  stroke="currentColor"
                  viewBox="0 0 24 24"
                >
                  <path
                    strokeLinecap="round"
                    strokeLinejoin="round"
                    strokeWidth="2"
                    d="M19 9l-7 7-7-7"
                  />
                </svg>
              </button>

              {isTypeOpen && (
                <div className="absolute mt-2 w-full bg-white rounded-lg shadow-lg p-4 z-20">
                  <div className="space-y-2">
                    <button
                      onClick={() => {
                        setOrgType("Non-Profit");
                        setIsTypeOpen(false);
                      }}
                      className="w-full px-4 py-2 text-left rounded-md hover:bg-cyan-50 hover:text-cyan-700"
                    >
                      Non-Profit
                    </button>
                    <button
                      onClick={() => {
                        setOrgType("For-Profit");
                        setIsTypeOpen(false);
                      }}
                      className="w-full px-4 py-2 text-left rounded-md hover:bg-cyan-50 hover:text-cyan-700"
                    >
                      For-Profit
                    </button>
                  </div>
                </div>
              )}
            </div>

            {/* Partnership Goal Input */}
            <div className="relative flex-1 min-w-[200px]">
              <button
                onClick={() => {
                  setIsGoalOpen(!isGoalOpen);
                  setIsLocationOpen(false);
                  setIsTypeOpen(false);
                }}
                className="w-full px-4 py-3 text-left bg-white rounded-lg shadow flex items-center justify-between hover:bg-gray-50"
              >
                <span className="flex items-center gap-2">
                  <svg
                    className="w-5 h-5 text-cyan-600"
                    fill="none"
                    stroke="currentColor"
                    viewBox="0 0 24 24"
                  >
                    <path
                      strokeLinecap="round"
                      strokeLinejoin="round"
                      strokeWidth="2"
                      d="M9 12l2 2 4-4m6 2a9 9 0 11-18 0 9 9 0 0118 0z"
                    />
                  </svg>
                  {goal ? "Goal Selected" : "Partnership Goal"}
                </span>
                <svg
                  className={`w-5 h-5 transition-transform ${
                    isGoalOpen ? "rotate-180" : ""
                  }`}
                  fill="none"
                  stroke="currentColor"
                  viewBox="0 0 24 24"
                >
                  <path
                    strokeLinecap="round"
                    strokeLinejoin="round"
                    strokeWidth="2"
                    d="M19 9l-7 7-7-7"
                  />
                </svg>
              </button>

              {isGoalOpen && (
                <div className="absolute mt-2 w-full bg-white rounded-lg shadow-lg p-4 z-20">
                  <label className="block text-sm font-medium text-gray-700 mb-2">
                    What Kind of Organization Are You Looking For?
                  </label>
                  <textarea
                    value={goal}
                    onChange={(e) => setGoal(e.target.value)}
                    className="w-full h-32 px-3 py-2 border border-gray-300 rounded-md shadow-sm focus:border-cyan-500 focus:ring-cyan-500"
                    placeholder="Describe your ideal partnership..."
                  />
                </div>
              )}
            </div>

            {/* Search Button */}
            <button className="px-8 py-3 bg-cyan-600 text-white rounded-lg shadow hover:bg-cyan-700 transition-colors">
              Search
            </button>
          </div>
        </div>
      </div>
    </div>
  );
};

export default PartnershipSearch;
